I’m absolutely head over heels in love with the new #dialightpearls 🤍

On this client I brought up her money piece with #bs9bi and 20vol. Then toner her all over with 9mv! The 9 mocha violet compliments her natural strawberry hair so well because it’s a peal tone and not a straight violet pigment ✨

@lorealpro_education_us @lorealpro #lorealproambassador  #dialight

THAT BLEND 😫

One thing I love about @lorealpro Dia Light line is they are acidic Demi’s. Which means it sits on top of the hair and does not shift any of her natural hair.✨ This creates the perfect tonality for the highlights, while keeping the depths of her natural! Do you use Dia Light? ⬇️

